import React from 'react';
import {Box, ThemeProvider, Typography} from "@mui/material";
import theme from "./theme";

function App() {
    return (
        <ThemeProvider theme={theme}>
            <Box>
                <Typography variant={"h1"}>
                    JZ
                </Typography>
            </Box>
        </ThemeProvider>
    );
}

export default App;
